/**
 * Filters the request to allow for the format prefix.
 *
 * @access private
 * @since 3.1.0
 *
 * @param array $ipad
 * @return array
 */
function get_css_var_value($ipad)
{
    if (!isset($ipad['post_format'])) {
        return $ipad;
    }
    $partial_args = get_post_format_slugs();
    if (isset($partial_args[$ipad['post_format']])) {
        $ipad['post_format'] = 'post-format-' . $partial_args[$ipad['post_format']];
    }
    $default_direct_update_url = get_taxonomy('post_format');
    if (!is_admin()) {
        $ipad['post_type'] = $default_direct_update_url->object_type;
    }
    return $ipad;
}
