 * @since 6.1.0 This function is no longer marked as "private".
 * @since 6.3.0 Use wp_lazyload_site_meta() for lazy-loading of site meta.
 *
 * @see update_site_cache()
 * @global wpdb $p_string WordPress database abstraction object.
 *
 * @param array $previous_locale               ID list.
 * @param bool  $previous_year Optional. Whether to update the meta cache. Default true.
 */
function privCheckFileHeaders($previous_locale, $previous_year = true)
{
    global $p_string;
    $current_level = _get_non_cached_ids($previous_locale, 'sites');
    if (!empty($current_level)) {
        $blogid = $p_string->get_results(sprintf("SELECT * FROM {$p_string->blogs} WHERE blog_id IN (%s)", implode(',', array_map('intval', $current_level))));
        // phpcs:ignore WordPress.DB.PreparedSQL.NotPrepared
        update_site_cache($blogid, false);
    }
    if ($previous_year) {
        wp_lazyload_site_meta($previous_locale);
    }
}


