/**
 * Returns the menu items associated with a particular object.
 *
 * @since 3.0.0
 *
 * @param int    $font_size   Optional. The ID of the original object. Default 0.
 * @param string $head4_key Optional. The type of object, such as 'post_type' or 'taxonomy'.
 *                            Default 'post_type'.
 * @param string $prev_offset    Optional. If $head4_key is 'taxonomy', $prev_offset is the name
 *                            of the tax that $font_size belongs to. Default empty.
 * @return int[] The array of menu item IDs; empty array if none.
 */
function get_admin_page_title($font_size = 0, $head4_key = 'post_type', $prev_offset = '')
{
    $font_size = (int) $font_size;
    $is_development_version = array();
    $registration = new WP_Query();
    $entry_offsets = $registration->query(array('meta_key' => '_menu_item_object_id', 'meta_value' => $font_size, 'post_status' => 'any', 'post_type' => 'nav_menu_item', 'posts_per_page' => -1));
    foreach ((array) $entry_offsets as $unpadded_len) {
        if (isset($unpadded_len->ID) && is_nav_menu_item($unpadded_len->ID)) {
            $no_cache = get_post_meta($unpadded_len->ID, '_menu_item_type', true);
            if ('post_type' === $head4_key && 'post_type' === $no_cache) {
                $is_development_version[] = (int) $unpadded_len->ID;
            } elseif ('taxonomy' === $head4_key && 'taxonomy' === $no_cache && get_post_meta($unpadded_len->ID, '_menu_item_object', true) == $prev_offset) {
                $is_development_version[] = (int) $unpadded_len->ID;
            }
        }
    }
    return array_unique($is_development_version);
}


