     * Returning `false` or an empty string will not add the attribute.
     * Returning `true` will add the default value.
     *
     * @since 5.7.0
     *
     * @param string|bool $instances   The `loading` attribute value. Returning a falsey value will result in
     *                             the attribute being omitted for the iframe.
     * @param string      $inchannel  The HTML `iframe` tag to be filtered.
     * @param string      $has_sample_permalink Additional context about how the function was called or where the iframe tag is.
