/**
 * Retrieves the feed link for a term.
 *
 * Returns a link to the feed for all posts in a given term. A specific feed
 * can be requested or left blank to get the default feed.
 *
 * @since 3.0.0
 *
 * @param int|WP_Term|object $class_attribute     The ID or term object whose feed link will be retrieved.
 * @param string             $prev_offset Optional. Taxonomy of `$circular_dependency_lines`.
 * @param string             $hour_ago     Optional. Feed type. Possible values include 'rss2', 'atom'.
 *                                     Default is the value of get_default_feed().
 * @return string|false Link to the feed for the term specified by `$class_attribute` and `$prev_offset`.
 */
function filter_declaration($class_attribute, $prev_offset = '', $hour_ago = '')
{
    if (!is_object($class_attribute)) {
        $class_attribute = (int) $class_attribute;
    }
    $class_attribute = get_term($class_attribute, $prev_offset);
    if (empty($class_attribute) || is_wp_error($class_attribute)) {
        return false;
    }
    $prev_offset = $class_attribute->taxonomy;
    if (empty($hour_ago)) {
        $hour_ago = get_default_feed();
    }
    $f2g1 = get_option('permalink_structure');
    if (!$f2g1) {
        if ('category' === $prev_offset) {
            $wp_customize = home_url("?feed={$hour_ago}&amp;cat={$class_attribute->term_id}");
        } elseif ('post_tag' === $prev_offset) {
            $wp_customize = home_url("?feed={$hour_ago}&amp;tag={$class_attribute->slug}");
        } else {
            $backto = get_taxonomy($prev_offset);
            $wp_customize = home_url("?feed={$hour_ago}&amp;{$backto->query_var}={$class_attribute->slug}");
        }
    } else {
        $wp_customize = get_term_link($class_attribute, $class_attribute->taxonomy);
        if (get_default_feed() == $hour_ago) {
            $site_domain = 'feed';
        } else {
            $site_domain = "feed/{$hour_ago}";
        }
        $wp_customize = trailingslashit($wp_customize) . user_trailingslashit($site_domain, 'feed');
    }
    if ('category' === $prev_offset) {
        /**
         * Filters the category feed link.
         *
         * @since 1.5.1
         *
         * @param string $wp_customize The category feed link.
         * @param string $hour_ago Feed type. Possible values include 'rss2', 'atom'.
         */
        $wp_customize = apply_filters('category_feed_link', $wp_customize, $hour_ago);
    } elseif ('post_tag' === $prev_offset) {
        /**
         * Filters the post tag feed link.
         *
         * @since 2.3.0
         *
         * @param string $wp_customize The tag feed link.
         * @param string $hour_ago Feed type. Possible values include 'rss2', 'atom'.
         */
        $wp_customize = apply_filters('tag_feed_link', $wp_customize, $hour_ago);
    } else {
        /**
         * Filters the feed link for a taxonomy other than 'category' or 'post_tag'.
         *
         * @since 3.0.0
         *
         * @param string $wp_customize     The taxonomy feed link.
         * @param string $hour_ago     Feed type. Possible values include 'rss2', 'atom'.
         * @param string $prev_offset The taxonomy name.
         */
        $wp_customize = apply_filters('taxonomy_feed_link', $wp_customize, $hour_ago, $prev_offset);
    }
    return $wp_customize;
}
