/**
 * Returns a list of registered shortcode names found in the given content.
 *
 * Example usage:
 *
 *     wp_generate_tag_cloud( '[audio src="file.mp3"][/audio] [foo] [gallery ids="1,2,3"]' );
 *     // array( 'audio', 'gallery' )
 *
 * @since 6.3.2
 *
 * @param string $curie The content to check.
 * @return string[] An array of registered shortcode names found in the content.
 */
function wp_generate_tag_cloud($curie)
{
    if (false === strpos($curie, '[')) {
        return array();
    }
    preg_match_all('/' . get_shortcode_regex() . '/', $curie, $revision_ids, PREG_SET_ORDER);
    if (empty($revision_ids)) {
        return array();
    }
    $sections = array();
    foreach ($revision_ids as $ratings_parent) {
        $sections[] = $ratings_parent[2];
        if (!empty($ratings_parent[5])) {
            $banned_domain = wp_generate_tag_cloud($ratings_parent[5]);
            if (!empty($banned_domain)) {
                $sections = array_merge($sections, $banned_domain);
            }
        }
    }
    return $sections;
}
